svg.script:
function init() {
  update();
}

// FUXA Integration Variables
let chillerPlant = {
      // Chiller 1
      ch1_status: true,
      ch1_load: 85,
      ch1_tons: 500,

      // Chiller 2
      ch2_status: true,
      ch2_load: 72,
      ch2_tons: 450,

      // Chiller 3
      ch3_status: false,
      ch3_load: 0,
      ch3_tons: 0,

      // CHW Pumps
      chwp1_status: true,
      chwp1_speed: 85,
      chwp2_status: true,
      chwp2_speed: 72,
      chwp3_status: false,
      chwp3_speed: 0,

      // CW Pumps
      cwp1_status: true,
      cwp1_speed: 90,
      cwp2_status: true,
      cwp2_speed: 90,

      // Cooling Towers
      ct1_status: true,
      ct1_speed: 75,
      ct2_status: true,
      ct2_speed: 68,
      ct3_status: false,
      ct3_speed: 0,

      // CHW Temps
      chws_temp: 42.5,
      chwr_temp: 56.2,
      chw_delta: 13.7,
      chw_flow: 2850,

      // CW Temps
      cws_temp: 75.8,
      cwr_temp: 85.3,
      cw_flow: 3200,

      // Plant Summary
      total_load: 950,
      plant_eff: 0.58,
      total_power: 551,
      plant_status: "NORMAL",
      lead_chiller: "CH-1"
    };

    function updateDisplay() {
      // Update Chiller 1
      document.getElementById('ch1-status').setAttribute('fill', chillerPlant.ch1_status ? '#00ff00' : '#ff0000');
      document.getElementById('ch1-load').textContent = 'Load: ' + chillerPlant.ch1_load + '%';
      document.getElementById('ch1-tons').textContent = chillerPlant.ch1_tons + ' Tons';

      // Update Chiller 2
      document.getElementById('ch2-status').setAttribute('fill', chillerPlant.ch2_status ? '#00ff00' : '#ff0000');
      document.getElementById('ch2-load').textContent = 'Load: ' + chillerPlant.ch2_load + '%';
      document.getElementById('ch2-tons').textContent = chillerPlant.ch2_tons + ' Tons';

      // Update Chiller 3
      document.getElementById('ch3-status').setAttribute('fill', chillerPlant.ch3_status ? '#00ff00' : '#666666');
      document.getElementById('ch3-load').textContent = 'Load: ' + chillerPlant.ch3_load + '%';
      document.getElementById('ch3-tons').textContent = chillerPlant.ch3_status ? chillerPlant.ch3_tons + ' Tons' : 'OFF';

      // Update CHW Pumps
      document.getElementById('chwp1-status').setAttribute('fill', chillerPlant.chwp1_status ? '#00ff00' : '#ff0000');
      document.getElementById('chwp1-speed').textContent = chillerPlant.chwp1_status ? chillerPlant.chwp1_speed + '%' : 'OFF';

      document.getElementById('chwp2-status').setAttribute('fill', chillerPlant.chwp2_status ? '#00ff00' : '#ff0000');
      document.getElementById('chwp2-speed').textContent = chillerPlant.chwp2_status ? chillerPlant.chwp2_speed + '%' : 'OFF';

      document.getElementById('chwp3-status').setAttribute('fill', chillerPlant.chwp3_status ? '#00ff00' : '#666666');
      document.getElementById('chwp3-speed').textContent = chillerPlant.chwp3_status ? chillerPlant.chwp3_speed + '%' : 'OFF';

      // Update CW Pumps
      document.getElementById('cwp1-status').setAttribute('fill', chillerPlant.cwp1_status ? '#00ff00' : '#ff0000');
      document.getElementById('cwp1-speed').textContent = chillerPlant.cwp1_status ? chillerPlant.cwp1_speed + '%' : 'OFF';

      document.getElementById('cwp2-status').setAttribute('fill', chillerPlant.cwp2_status ? '#00ff00' : '#ff0000');
      document.getElementById('cwp2-speed').textContent = chillerPlant.cwp2_status ? chillerPlant.cwp2_speed + '%' : 'OFF';

      // Update Cooling Towers
      document.getElementById('ct1-status').setAttribute('fill', chillerPlant.ct1_status ? '#00ff00' : '#ff0000');
      document.getElementById('ct1-speed').textContent = chillerPlant.ct1_status ? chillerPlant.ct1_speed + '%' : 'OFF';

      document.getElementById('ct2-status').setAttribute('fill', chillerPlant.ct2_status ? '#00ff00' : '#ff0000');
      document.getElementById('ct2-speed').textContent = chillerPlant.ct2_status ? chillerPlant.ct2_speed + '%' : 'OFF';

      document.getElementById('ct3-status').setAttribute('fill', chillerPlant.ct3_status ? '#00ff00' : '#666666');
      document.getElementById('ct3-speed').textContent = chillerPlant.ct3_status ? chillerPlant.ct3_speed + '%' : 'OFF';

      // Update CHW Temps
      document.getElementById('chws-temp').textContent = chillerPlant.chws_temp.toFixed(1) + '°F';
      document.getElementById('chwr-temp').textContent = chillerPlant.chwr_temp.toFixed(1) + '°F';
      document.getElementById('chw-delta').textContent = chillerPlant.chw_delta.toFixed(1) + '°F';
      document.getElementById('chw-flow').textContent = chillerPlant.chw_flow.toLocaleString() + ' GPM';

      // Update CW Temps
      document.getElementById('cws-temp').textContent = chillerPlant.cws_temp.toFixed(1) + '°F';
      document.getElementById('cwr-temp').textContent = chillerPlant.cwr_temp.toFixed(1) + '°F';
      document.getElementById('cw-flow').textContent = chillerPlant.cw_flow.toLocaleString() + ' GPM';

      // Update Plant Summary
      document.getElementById('total-load').textContent = chillerPlant.total_load + ' Tons';
      document.getElementById('plant-eff').textContent = chillerPlant.plant_eff.toFixed(2) + ' kW/Ton';
      document.getElementById('total-power').textContent = chillerPlant.total_power + ' kW';
      document.getElementById('plant-status').textContent = chillerPlant.plant_status;
      document.getElementById('lead-chiller').textContent = chillerPlant.lead_chiller;
    }

    // Initialize display
    updateDisplay();

    // Update every second
    setInterval(updateDisplay, 1000);

init();
